import React, { Component } from 'react';
import styled from 'styled-components';

const Hello = styled.div`
  font-size: 30px;
  color: palevioletred;
`
const Header = styled.div`
  height: 100px;
  background-color: papayawhip;
  padding: 5px;
  display:flex;
  align-items: center;
  justify-content: space-around;
`

class App extends Component {

  render() {
    return (
      <Wrapper>
        <Header>
          <Hello>
            Jessica Long
          </Hello>
          <Hello>
            Leah Long
          </Hello>
          <Hello>
            Jared Long
          </Hello>
        </Header>
      </Wrapper>  
    );
  }
}

export default App;
